import { Injectable } from '@angular/core';
import { HousingLocation } from './housing-location';

@Injectable({
  providedIn: 'root'
})
export class HousingService {
  // ✅ Directly embed the JSON data
  private locations: HousingLocation[] = [
    {
      "id": 0,
      "name": "AdamKizis.com",
      "city": "Chicago",
      "state": "IL",
      "photo": "/assets/bernard-hermant-CLKGGwIBTaY-unsplash.jpg",
      "availableUnits": 4,
      "wifi": true,
      "laundry": true,
      "url": "https://adamkizis.com",
      "info": "Sort of a portfolio website for myself.",
      "stack": "Static Website using Bootstrap.",
    },
    {
      "id": 1,
      "name": "A113 Transitional Housing",
      "city": "Santa Monica",
      "state": "CA",
      "photo": "/assets/brandon-griggs-wR11KBaB86U-unsplash.jpg",
      "availableUnits": 0,
      "wifi": false,
      "laundry": true
    },
    {
      "id": 2,
      "name": "Warm Beds Housing Support",
      "city": "Juneau",
      "state": "AK",
      "photo": "/assets/i-do-nothing-but-love-lAyXdl1-Wmc-unsplash.jpg",
      "availableUnits": 1,
      "wifi": false,
      "laundry": false
    }
  ];

  constructor() { }

  // ✅ Return the static data directly
  async getAllHousingLocations(): Promise<HousingLocation[]> {
    return Promise.resolve(this.locations);
  }

  async getHousingLocationById(id: number): Promise<HousingLocation | undefined> {
    return Promise.resolve(this.locations.find(location => location.id === id));
  }

  submitApplication(firstName: string, lastName: string, email: string) {
    console.log(`Application submitted: ${firstName} ${lastName}, Email: ${email}`);
  }
}
